INSERT INTO `document` VALUES (652,'This is a Very Official document for testing','2024-01-10 18:05:38.483000','2024-01-10 18:05:38.483000','Official Test Document :)',NULL,2),(854,'<h1>PeponapisPeponapisPeponapisPeponapisPeponap<strong><em>isPeponapis helppppp</em></strong></h1><h1>IMAGES ARE GETTING SAVED!!!!!!</h1><p><img src=\"data:image/png;base64,\"></p><p><br></p><p><img src=\"data:image/png;base64,\"></p>','2024-01-12 14:15:21.257000','2024-01-12 19:25:00.483000','Peponapis',NULL,52),(1053,'<h1>Presentation Plan :D</h1><h1><br></h1><h1>Script :D MAKE YOU SURE YOU SMILE :D MOTTO IS S &amp; S=&nbsp;</h1><h1>SMILE &amp; SLOW</h1><p>STAND IN THE MIDDLE - BE PRESENTABLE. NO SHIFTING!</p><p>** Introducing ourselves**</p><p>Christy: <em>Hello&nbsp; my name is Christianne Edgard but&nbsp; I go by Christy. I m a US Veteran, serving in in the PA US ARMY NATIONAL GUARD.</em></p><p>Tam: <em>Hello :D My name :D is :DD Tam Maria Doan :D Im a former Passenger Service Agent with Sun Country Airlines :D</em></p><p>Jia: Hello, my name is Hyunji Lee. I go by Jia.&nbsp; Im a former emergency medical scribe</p><p><br></p><p>**Christy is the driver** - PAUSE? LET CHRISTY WALK TO COMPOOOTUR, BOOK IT CHRISTY YESSIR</p><p>Jia: Meet ZipDocs, our document library application. ZipDocs is a user-friendly and document editing platform that allows users to view, edit, create, and export documents with simplicity. Manage and share your documents with ZipDocs! Our Tech Stack is Java, Spring Booty, Javascript, React, and MySQL</p><p>The Drive Through (Concise into 1:20 Time limit each person - tomorrow stand up).</p><ul><li><strong>Login In As A User &amp; Create Document </strong>&nbsp;- Jia &nbsp; Pilot: Christy&nbsp;</li><li> 		Jia: This is ZipDocs homepage for all users. Here we have all our documents in the open library that is displayed by the most recently modified document. The display uses a get method that retrieves all documents from our database(<em>PILOT: LOGIN</em>). Currently as a logged out user, users can only view documents.(<em>PILOT: CLICK CREATE DOCUMENT</em>). Once you are logged in, you can create a document. Each document has its own unique id and an author id which matches with the user id in our sql database. We will put a title in for our document. The document is now created. The create button does a post method to our rest controller to save the title of our document to our sql database and leaves an empty string for the body of the document (<em>PILOT: CLICK DOCUMENT AND NAME TITLE THEN CLICK CREATE</em>). I will pass it to Tam to talk about the Text Editor&nbsp;</li><li><strong>Text Editor features</strong> (bold  its broken!!!!!!, italic, etc.) - Tam&nbsp; Pilot: Christy</li><li> 		JIA: For our text editor, we made use of Quill, a WYSIWYG editor. (<em>PILOT: START TYPING AND/OR COPY PASTE SOME PRE-MADE TEXT)</em> Quill handles the formatting, so when we format our text using the buttons above (<em>PILOT: GO CRAZY WITH BUTTONS  JUST NO BOLD!!! PLEASE ADD AN IMAGE!</em>) to make some words italicized or underlined, create bulleted or numbered lists, or even import images, itll reflect in our editor.&nbsp;</li><li><strong>Saving a Document </strong>- Tam&nbsp; Pilot: Christy</li><li> 		Tam: To save, all the user needs to do is hit the save button (<em>PILOT: PRESS SAVE BUTTON</em>). What happens here is that we take the text from Quill, which comes with all the formatting, and store it into our MySQL db as a large object so that (<em>PILOT: GO HOME THEN CLICK ON THE DOCUMENT AGAIN</em>) next time a user opens up the document, all their formatting is saved. Ill pass it back to Jia to talk about extra features of our editor.</li><li><strong>Exporting a Document to PDF / Clearing a Document </strong>- Jia&nbsp; Pilot: Christy</li><li> 		TAM: Other functions to our text editor are the export and clear buttons. Export allows any user to get a PDF version of the document.(PILOT: CLICK EXPORT) Clear allows the user that owns the document to clear the entire document. (PILOT: CLEAR DOCUMENT)&nbsp; Ill pass back to Tam to talk about delete feature.</li><li><strong>Delete a document</strong> (Tam working on) - Tam &nbsp; Pilot: Christy</li><li> 		Tam: (<em>PILOT: GO HOME)</em> As youve probably noticed, after a user logs in, all the documents that theyve created now have a delete button at the corner. (<em>PILOT: CLICK THE BOOOOOTTUN</em>) Once a user clicks the button, therell be a confirmation menu about whether theyre sure or not, and if they hit yes (<em>PILOT: HIT YES</em>), thatll send a DELETE request along with the id of the document to be deleted. Now, Ill give it to Christy to talk about our search feature.</li><li><strong>Sorting documents</strong> (not done yet) -Christy &nbsp;Pilot: Jia</li><li> 	Christy:</li><li><strong>Searching documents</strong> - Christy &nbsp; Pilot: Jia</li><li> 	Christy:&nbsp;</li></ul><p><br></p><p><br></p><p>Those are all our main features of ZipDocs. We would love to answer any questions.</p><h2><br></h2>','2024-01-15 15:37:17.230000','2024-01-15 15:40:12.076000','Peponapis\' Script',NULL,1),(1054,'<h1>Current Features List</h1><ul><li>Login/Logout</li><li>CRUD</li><li>Export</li><li>Search</li><li>Sort docs</li><li>Extras for the editor</li></ul><p><br></p><p><br></p><h1>Features for the future:</h1><ul><li>Folders</li><li>Storing images</li><li>Multi-edit a document</li><li>Document limited sharing</li><li>Autosave!</li><li>Favorites</li></ul>','2024-01-15 15:40:39.301000','2024-01-15 17:21:33.938000','Peponapis\' Features ToDo List',NULL,1),(1055,'<h1>One Pager Zip Doc</h1><h2>Peponapis Group Project</h2><p><br></p><p>Zip Doc is a user-friendly and web-based document editing platform inspired by Google Docs, enabling real-time editing and seamless document sharing with users. Store your documents all in one easy-to-reach library! Users can create, view, and organize documents.</p><p><br></p><p><br></p><p>ZipDoc Discovery (Guest Access)</p><ul><li>As a guest to ZipDoc, you can easily browse and view a list of documents and folders</li><li>Access and view any specific document with a simple click and freely view the content</li></ul><p><br></p><p>Document Creation and Editing (Logged-in Users)</p><ul><li>Once a user is logged in, a user can create new documents seamlessly, incorporating both images and text</li><li>Using a well-known JavaScript text editor for a fluid editing experience</li></ul><p><br></p><p>Document Organization and Search</p><ul><li>Easily manage your documents by accessing a personalized list of your own documents</li></ul><p><br></p><p>Document Integration</p><ul><li>Download and upload documents directly to/from your device&nbsp;</li></ul><p><br></p><p>User-Friendly Interface</p><ul><li>ZipDoc ensures a user-friendly interface to allow a pleasant and easy experience to create, view, edit, and organize documents</li></ul><p><br></p><p><br></p><p>MVP:&nbsp;</p><ul><li>A user will be able to create, edit, and view documents.</li></ul><p><br></p><p><br></p><p><br></p><p>Tech Stack:</p><p>Java, Spring Boot, JavaScript, React, AWS (S3) bucket, and docker container</p>','2024-01-15 15:45:47.723000','2024-01-15 15:46:26.473000','Zip Docs One Pager',NULL,1),(1056,'<h2>MODELS OF COMPUTATION:</h2><p><br></p><p>Functional: Computation model based on the recursive definition of functions</p><ul><li>Breaks things down into simpler functions of inputs and outputs until you reach the base</li><li>Lisp, ML, Haskel</li></ul><p><br></p><p>Dataflow: computation model is a flow of info (tokens) among (primitive) functional nodes.</p><ul><li>Node is triggered by the arrival of a token as input to generate output.</li><li>Computation is <em>inherently </em>parallel</li><li>Languages: Id, Val, SISAL</li></ul><p><br></p><p>Logic/Constraint-based: based on the predicate logic, which attempts to find values that satisfy specified relationships using goal-directed search through logical rules</p><ul><li>Languages: Prolog, SQL, XSLT, Excel</li></ul><p><br></p><p>Von Neumann: ultimately based on the modification of variables</p><ul><li>***Functional languages have <em>expressions </em>with <em>values</em>, von Neumann have <em>statements </em>that affect subsequent statements via<em> side effects</em> on memory***</li><li>Language: Fortran, Algol, Cobol, Basic, Pascal, Ada, C</li></ul><p><br></p><p>Object-Oriented: closely related to above, but more tightly controlled. Instead of changing variables, a program is an interaction among (semi-)independent objects, each with its own state and subroutines to modify that state</p><ul><li>Languages: Simula, Smalltalk, C++, Java</li><li>Functional+OO Language: CLOS (common lisp object system) [prof likes this language/thinks its cool], OCaml, F# (Microsoft language)</li></ul><p><br></p><p>Scripting: Kind of a catch-all category to describe languages that are (generally) used to stitch together other items</p><ul><li>Job control: JCL (Job Control Language), csh, bash (Born Again SHell), PowerShell, AppleScript</li><li>Dynamic web content: JavaScript, PHP</li></ul><p><br></p><p>Embedded app control: TCL (Tool Control Language), Lua, Python (prof says: Python is way beyond embedded app control now)</p><ul><li>General Purpose: Perl, Python, Ruby</li></ul><p><br></p>','2024-01-15 15:51:01.457000','2024-01-15 16:28:54.404000','Models of Computation',NULL,52),(1057,'<p>COMPILING A PROGRAM</p><ul><li>A <em>compiler </em>translates a <em>source </em>program into an equivalent target program and then goes away</li><li>At some later time, the target program can be executed</li><li>During compilation, the compiler is the <em>locus of control&nbsp;</em></li><li>During its own execution, the target program is the locus of control</li><li>Typically, the compiler is a machine language program</li></ul><p><br></p><p>INTERPRETING A PROGRAM</p><ul><li>An interpreter, on the other hand, typically stays around for the execution of the target program</li><li>The interpreter is the locus of control during all parts of the execution</li><li>The interpreter is in effect a VM whose machine language is the programming language</li><li>Translates every time</li><li>Source program &amp; Input  Interpreter  Output</li><li>Generally, interpretation is more flexible and has better diagnostics than compilation</li><li>The source code for the program is still available</li><li>Some language features are very difficult to implement without interpretation</li><li>I.e. On the fly code-generation</li><li>I.e. printfs in C</li><li>REPL (Read-Eval-Print-Loop) - interactive environment wherein the user types a line at a time which is then evaluated and results displayed</li></ul><p><br></p><p>COMPILATIONS V. INTERPRETATION</p><ul><li>In both, instructions are executed on the target processor</li><li>A compiler generated instructions by analyzing the source code in its entirety and optimizes the generated code based on the entire source code and specific optimizations</li><li>The generation of the instructions is (generally) independent of the execution of the target program</li><li>An interpreter typically reads one line at a time</li><li>It cannot perform overall analysis of the code as it does not know all of the code</li><li>It therefore executes one line at a time without optimization</li><li>It must read the source code and generate instructions as it is execution the target program</li><li>It may take several operations for an interpreter to accomplish the same operation a compiler would have generated the interpretation in another language</li><li><strong>Interpretation</strong>:</li><li>Dont have to wait for compile and link steps</li><li>Usually take less space than a compiler</li><li>Much easier to port an interpreter</li><li><strong>Compiler</strong>:</li><li>Generally better performance/faster</li></ul><p><br></p>','2024-01-15 16:30:33.162000','2024-01-15 16:31:24.025000','Compiler vs Interpreter',NULL,52),(1058,'<p>DEFINITION OF A RE (<em>MEMORIZE THESE!!!!!</em>)</p><p><br></p><ol><li>A <em>character</em></li><li>The <em>empty string</em> (denoted as epsilon)</li><li>The <em>concatenation </em>of two REs (Meaning one RE after the other RE)</li><li>The <em>alternation </em>of two REs denoted by | (Meaning one RE <em>or </em>the other RE)</li><li>An RE followed by the <em>Kleene </em>(clay-knee) <em>star </em>denoted as * (Meaning 0 or more repetitions of the RE)</li></ol><p><br></p><p>DEFINITION</p><p><br></p><ul><li>The set of strings defined by an RE is known as its <em>language</em></li><li>RE is <em>not </em>allowed to recurse (single greatest limitation)</li><li>No part of a RE can refer to itself, even indirectly</li><li>If it did, its no longer a RE, but maybe a CFG instead</li><li>Remember Chomsky Language Hierarchy (mod 2, slide 5)</li></ul>','2024-01-15 16:34:23.833000','2024-01-16 09:35:02.539000','Regular Expressions',NULL,52),(1059,'<h2>Project Landfill Retro</h2><p><br></p><p>There are numerous statistics that were found on how clothes have been infiltrating the landfills affect our Earth directly by creating land pollution. It is found that Globally, 80% of the discarded textiles are doomed for the landfill or incineration. Only 20% are actually reused or recycled. Aside from Earth getting affected by harmful greenhouse gases, farmers are also using 218 billion Liters of water more in order to grow more cotton.&nbsp;</p><p><br></p><p>As we can see the infiltration of textiles is not only causing physical, societal but also economical issues and in order to minimize the effects, we were assigned Project Trash this semester. As being young professionals and also consumers of this material it was best for us to look into this issue and try finding a solution to reduce textile waste.&nbsp;</p><p><br></p><p>In a span of six months and three phases, in a team, we were able to learn about the side effects and discover possible solutions. In our process of building and learning, we achieved our target by planning ahead, working with our requirements, using computer software to generate charts (Schema/EER). Aside from the planning phase, we learned different languages which helped us to implement our design.</p><p><br></p><p>Lastly, to give a special note to this project a personal influential statement from the team contributions is below:</p><p><br></p><ul><li>This project had a positive impact on my lifestyle. I have become mindful of online purchases and the effect of online returns. 							- Kiran Karki&nbsp;</li></ul><p><br></p><ul><li>I have always been concerned about plastic waste. And this project has helped me to see, from another angle of view, how the wastes are created from online returns and how it impacts the world. 									 &nbsp; &nbsp; &nbsp; - Rikrish Shrestha</li></ul><p><br></p><ul><li>Working on this project has made me aware of the daily choices I choose. I will definitely choose quality over quantity, I will try to shop at local second-hand shops for clothes so I can play a part in recycling clothes and in greater terms reducing the products returned to be part of landfills. &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; - Inara Rupani</li></ul><p><br></p><ul><li>I had never realized how much-returned clothing contributed to landfill waste. This project helped bring awareness to how I as an individual contribute to the growing problem, as well as what measures I can take to reduce it. 					 &nbsp; &nbsp;  Tam Maria Doan</li></ul><p><br></p><ul><li>Regularly I handle online clothes through purchases at brick and mortar stores, it has however made me take notice of how much garbage is generated in my house, I have encouraged my roommates to recycle more!</li></ul><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;												&nbsp; Austin Hansen</p><p><br></p>','2024-01-15 16:49:22.960000','2024-01-15 16:50:07.673000','Project Retro',NULL,102),(1060,'<p><img src=\"data:image/png;base64,\"></p>','2024-01-15 16:57:26.870000','2024-01-15 16:59:32.759000','Schema',NULL,102),(1061,'<p>What <em>is </em>DNA computing? Its exactly what it sounds like! DNA computing is a branch of computer science that uses DNA, biochemistry, and molecular biology hardware instead of the traditional silicon-based hardware that most of our computers are using right now. Compared to other branches, dna computing is a fairly new field. Though the idea of it was thought up as early as 1959, it wasnt formally developed into a field until around 1994 by Leonard Adleman, a professor at the University of Southern California. He used dna computing to solve the traveling salesman problem, which, for those that dont know, is a problem to find the shortest path between a number of cities while only going through each city once. Its a problem that gets more difficult the more cities are added. His experiment proved that DNA could be used to solve complex math problems.</p><p><br></p><p>DNA can do a lot of things, things like inheritance, storing information, and solving logic problems. The idea behind dna computing is to base information off of dnas four nitrogen bases (A, G, C, and T), rather than the traditional binary alphabet (0,1). There are several advantages to using DNA: first is its practically unlimited supply - as long as there are organisms, there will be DNA. Second is that DNA chips can be made cleanly - this means, when making them, there arent any of the toxic materials found in microchips today.&nbsp;</p><p><br></p><p>DNA is also expected to make computers smaller, and its potential for storage and holding data is several times more impressive than our current hardware. One pound of DNA has the capacity to store more information than all the electronic computers ever built. On a smaller scale, a DNA computer the size of a teardrop will be more powerful than our worlds current most powerful supercomputer.</p><p><br></p><p>What makes DNA computing even more enticing is its ability for parallel computations. Current computations are done linearly, step by step and line by line -- because of this, when it comes to more complex problems, it could take days to complete them. If you try an even more complicated problem, forget weeks or months, it might even take centuries to finish! With the ability to perform calculations in parallel to each other, DNA computers may be able to solve these problems in just a couple of hours.</p><p><br></p><p>Of course, there must be some disadvantages, too -- even more so because dna computing is so new. There are two main ones. First and foremost is speed. DNA computers are several decades behind our current computers. Though its ability for parallel computations is there, dna computers processing speed isnt as fast as the computers were using now.&nbsp;</p><p><br></p><p>The second disadvantage can be summarized with a single line: Using DNA to compute is like having to build a new computer out of new hardware just to run a new piece of software. Its like having to build a computer to play a game, and building a completely new computer to play another. Sounds troublesome, right? The second disadvantage is that dna computers are inflexible. Once youve coded software into the dna, youd have to get a new set of DNA to write a different piece of software -- At least, until now.</p><p><br></p><p>About three weeks ago, with the help of professors from Maynooth University in Ireland, computer scientists at Caltech were able to create the worlds first repogrammable dna computer. The way it works is through algorithmic self-assembly, which is where DNA strands stick together to build a logic circuit while carrying out the algorithm at the same time. Though its only a six-bit computer, they were able to create and run about 21 different programs, ranging from counting to drawing pictures to calculating equality checks, from a single test tube of dna. Theyve essentially solved one of the key problems between our current computers and dna computers.</p><p><br></p><p>With the creation of the first reprogrammable DNA computer, time, memory, and processing will eventually be held to new standards. Most likely, DNA computers will first make their way into the government and other big businesses like airlines, so that they could assist in cracking codes and creating more efficient travel routes. Though we wont see these DNA computers in our home in the next decade or so, possible paths and advancements not only in DNA computing and computer science, but also in other fields like biology and biochemistry, have been opened with this six-bit reprogrammable DNA computer.&nbsp;</p><p><br></p>','2024-01-15 17:03:39.171000','2024-01-15 17:12:38.502000','DNA Computing',NULL,102);
